import React from 'react'
import './welcomes.css'

function welcome() {
    return (
        <div class="topnav">
            <a class="active" href="#home">Home</a>
            <a href="#news">What We Do</a>
            <a href="#contact">Team</a>
            <a href="#about">About</a>
        </div>
    )
}

export default welcome
